const MessagesWithUser = (props) =>{
    const date = props.DialogsMessagesTemp.items[0].addedAt.split("T")[0]
    const time = props.DialogsMessagesTemp.items[0].addedAt.split("T")[1].split(".")[0]
    return <div>
        {props.DialogsMessagesTemp.items[0].body}
<span>
    {date}
    <div>
    {time}
    </div>
</span>

    </div>
}
export default MessagesWithUser
